var handleDashboardTodolist = function () {
    "use strict";
    $("[data-click=todolist]").click(function () {
        var e = $(this).closest("li");
        if ($(e).hasClass("active")) {
            $(e).removeClass("active")
        } else {
            $(e).addClass("active")
        }
    })
};
